import React from 'react';
import s from "./TaskButtons.module.css";
import {FormButton} from "../../../Common/FormButton";

const TaskButtons = (props) => {

    return (<div>
{/*            <div>
                <button className={s.add} onClick={props.addNewTask}>Add Task</button>
            </div>*/}
            <div>
                <FormButton onClick={props.onNameSort}>Sort by name</FormButton>
            </div>
            <div>
                <FormButton onClick={props.onPrioritySort}>Sort by priority</FormButton>
            </div>
        </div>
    );
};

export default TaskButtons;
